import React from "react";

//image
import logo from "../../UI/Img/softechsolutions_header_log.png";
import logo_s from "../../UI/Img/softechsolutions_logo.png";

//bootstrap
import { Card } from "react-bootstrap";

//css
import style from "../Footer/footer.module.css";

const Footer = () => {
  return (
    <div className={style.footer_container}>
      <Card border="primary" bsPrefix={style.card_container}>
        <div className={style.card_img_container}>
          <Card.Img
            variant="top"
            src={logo_s}
            style={{ width: "2rem" }}
            bsPrefix={style.card_img}
          />
          <Card.Img
            variant="top"
            src={logo}
            style={{ width: "10rem" }}
            bsPrefix={style.card_img}
          />
        </div>
        {/* <Card.Img variant="top" src={logo_s} style={{width:"2rem"}} bsPrefix={style.card_img}/>
        <Card.Img variant="top" src={logo} style={{width:"10rem"}} bsPrefix={style.card_img}/> */}

        <Card.Body>
          <Card.Title>Info</Card.Title>
          <Card.Text>
            Softech ERP Solutions Pvt. Ltd. is a software development firm
            located in the metropolis of Kolkata, India. The company started its
            operation as Softech Solutions in 2002 and was later incorporated in
            2011.
          </Card.Text>
        </Card.Body>
      </Card>
    </div>
  );
};

export default Footer;
